import React from 'react'
import Form from './Form'
import UploadImageZone from './UploadImageZone'

const FormHasImage = () => {
    return (
        <Form title='Prompt Sketch to Image' >
            <UploadImageZone />
        </Form>
    )
}

export default FormHasImage
